// Home.js
import React from 'react';
import { Link } from 'react-router-dom';
import { WidthProvider, Responsive } from 'react-grid-layout';
import BentoBoxes from '../components/BentoBoxes';
import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import 'react-grid-layout/css/styles.css';
import 'react-resizable/css/styles.css';
import { FaMicrophone, FaWrench} from 'react-icons/fa';

const ResponsiveGridLayout = WidthProvider(Responsive);

const Home = () => {
  // Layout definition
  const layouts = {
    lg: [
      { i: 'box1', x: 0, y: 0, w: 2, h: 2 },
      { i: 'box2', x: 2, y: 0, w: 2, h: 4 },
      // Add more boxes as needed
    ],
    // Define other breakpoints as needed
  };

  return (
    <Container fluid className="dark:bg-theme-dark-background text-theme-light-text dark:text-theme-dark-text h-screen overflow-hidden d-flex flex-column justify-content-between">
      <Row className="pt-8 pl-8 pr-8 justify-content-between align-items-center">
        <Col xs="auto" className="text-4xl font-bold">Home</Col>
      </Row>
      <ResponsiveGridLayout className="layout" layouts={layouts} breakpoints={{lg: 1200}} cols={{lg: 12}}>
        <div key="box1" className="grid-item">Box 1</div>
        <div key="box2" className="grid-item">Box 2</div>
        {/* Add more boxes as needed */}
      </ResponsiveGridLayout>
      <Row className="pr-8 pl-8 pb-5 align-items-center justify-content-between">
        <Col xs="auto">
          <Button variant="primary">
            <FaMicrophone size={24}/> {/* Microphone icon for Speech */}
          </Button>
        </Col>
        <Col md={6} className="d-flex justify-content-center">
          <Form.Control type="search" placeholder="Search" />
        </Col>
        <Col xs="auto">
          <Button variant="primary">
            <FaWrench size={24}/> {/* Wrench icon for Settings */}
          </Button>
        </Col>
      </Row>
    </Container>
  );
};

export default Home;
